  internal->interpolate_beta = cinterpolate_alloc("linear", internal->dim_tt, 1, internal->tt, internal->beta_t, true, false);
  interpolate_check_y(internal->dim_tt, internal->dim_eta_h_t, 0, "eta_h_t", "eta_h");
